import React from 'react';
import { useNavigate } from 'react-router-dom';
import { useCart } from '../Context/CartContext';
import './Cart.css';

const Cart = () => {
  const {
    cartItems,
    removeFromCart,
    updateQuantity,
    cartTotal,
    clearCart,
    loading,
    error
  } = useCart();
  
  const navigate = useNavigate();

  const handleQuantityChange = async (productId, newQuantity) => {
    if (newQuantity >= 1) {
      try {
        await updateQuantity(productId, parseInt(newQuantity));
      } catch (error) {
        console.error("Error updating quantity:", error);
      }
    }
  };

  const handleProceedToCheckout = () => {
    navigate('/checkout');
  };

  if (loading) return <div className="loading">Loading cart...</div>;
  if (error) return <div className="error">{error}</div>;

  if (cartItems.length === 0) {
    return (
      <div className="empty-cart">
        <h2>Your Cart is Empty</h2>
        <button onClick={() => navigate('/products')}>
          Continue Shopping
        </button>
      </div>
    );
  }

  return (
    <div className="cart-container">
      <h1>Your Shopping Cart</h1>
      
      <div className="cart-content">
        <div className="cart-items">
          {cartItems.map((item) => (
            <div key={item.productId._id} className="cart-item">
              <div className="item-image">
                <img 
                  src={item.productId.image || '/placeholder-image.jpg'} 
                  alt={item.productId.name} 
                />
              </div>
              
              <div className="item-details">
                <h3>{item.productId.name}</h3>
                <p>Rs. {item.productId.price.toFixed(2)}</p>
                <div className="item-quantity">
                  <button 
                    onClick={() => handleQuantityChange(item.productId._id, item.quantity - 1)}
                    disabled={item.quantity <= 1}
                  >
                    -
                  </button>
                  <input
                    type="number"
                    value={item.quantity}
                    min="1"
                    onChange={(e) => handleQuantityChange(item.productId._id, e.target.value)}
                  />
                  <button 
                    onClick={() => handleQuantityChange(item.productId._id, item.quantity + 1)}
                    disabled={item.quantity >= 10}
                  >
                    +
                  </button>
                </div>
                <button 
                  onClick={() => removeFromCart(item.productId._id)}
                >
                  Remove
                </button>
              </div>
              
              <div className="item-total">
                Rs. {(item.productId.price * item.quantity).toFixed(2)}
              </div>
            </div>
          ))}
        </div>
        
        <div className="cart-summary">
          <h2>Order Summary</h2>
          <div className="summary-row">
            <span>Subtotal ({cartItems.reduce((total, item) => total + item.quantity, 0)} items)</span>
            <span>Rs. {cartTotal.toFixed(2)}</span>
          </div>
          <div className="summary-row">
            <span>Shipping</span>
            <span>Free</span>
          </div>
          <div className="summary-row total">
            <span>Total</span>
            <span>Rs. {cartTotal.toFixed(2)}</span>
          </div>
          
          <button onClick={handleProceedToCheckout}>
            Proceed to Checkout
          </button>
          
          <button onClick={clearCart}>
            Clear Cart
          </button>
        </div>
      </div>
    </div>
  );
};

export default Cart;
